import * as React from 'react';

import Beer from './beer';

interface BeerContainer {
    beers: Array<Beer>
};

export default class BeerList extends React.Component {
    beers: Array<Beer> = [];

    constructor(props:Array<Beer>) {
        super([undefined]);
        this.beers = props;
    }

    render () {
        return (
            <div>
                {this.beers.map((b: React.ReactNode) => (
                    <li>{b}</li>
                ))}
            </div>
    );
    }
}
